import React, { useState } from 'react';
import Parse from 'parse';

const Home = () => {
  const [courses] = useState([
    { id: "linux", title: "Linux Admin", price: "55,000 MMK", duration: "2 Months", vidId: "yv_vPAtE_kQ", img: "https://images.unsplash.com/photo-1629654297299-c8506221ca97", detail: "Master Linux CLI, Server Management, and Security Auditing." },
    { id: "cyber", title: "Cyber Security", price: "75,000 MMK", duration: "3 Months", vidId: "Z3_6qJ0pGno", img: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b", detail: "Learn Threat Hunting, SOC Analysis, and Incident Response." },
    // ·Äê·ÄÅ·Äº·Ä¨·Ä∏ course ·Äê·ÄΩ·Ä± ·Äí·ÄÆ·Äë·Ä≤·Äô·Äæ·Ä¨ ·ÄÜ·ÄÄ·Ä∫·Äë·Ää·Ä∑·Ä∫·Äú·Ä≠·ÄØ·Ä∑·Äõ·Äï·Ä´·Äê·Äö·Ä∫...
  ]);

  const [selectedCourse, setSelectedCourse] = useState(null);
  const [showEnrollForm, setShowEnrollForm] = useState(false);
  const [studentName, setStudentName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [selectedPayment, setSelectedPayment] = useState('kpay');
  const [receiptFile, setReceiptFile] = useState(null);
  const [receiptPreview, setReceiptPreview] = useState(null);
  const [isSubmitting, setIsSubmitting] = useState(false);

  const payments = {
    kpay: { name: "KPay", acc: "09 123 456 789", logo: "/images/unnamed.png" },
    wave: { name: "Wave Money", acc: "09 987 654 321", logo: "/images/images.jpeg" },
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setReceiptFile(file);
      setReceiptPreview(URL.createObjectURL(file));
    }
  };

  const handleSubmitMission = async () => {
    if (!studentName || !phoneNumber || !receiptFile) { 
      alert("·Ä°·Äô·Ää·Ä∫·Åä ·Äñ·ÄØ·Äî·Ä∫·Ä∏·Äî·Ä∂·Äï·Ä´·Äê·Ä∫ ·Äî·Äæ·ÄÑ·Ä∑·Ä∫ ·Äï·Äº·Ä±·ÄÖ·Ä¨ ·Ä°·Ä¨·Ä∏·Äú·ÄØ·Ä∂·Ä∏ ·Äï·Äº·Ää·Ä∑·Ä∫·ÄÖ·ÄØ·Ä∂·Ä°·Ä±·Ä¨·ÄÑ·Ä∫ ·Äë·Ää·Ä∑·Ä∫·Äï·Ä±·Ä∏·Äï·Ä´·ÄÅ·ÄÑ·Ä∫·Äó·Äª·Ä¨·Åã"); 
      return; 
    }
    setIsSubmitting(true);
    try {
      const Enroll = Parse.Object.extend("Enrollments");
      const enroll = new Enroll();

      const parseFile = new Parse.File("receipt.jpg", receiptFile);
      await parseFile.save();

      enroll.set("studentName", studentName);
      enroll.set("phoneNumber", phoneNumber);
      enroll.set("courseTitle", selectedCourse.title);
      enroll.set("paymentMethod", selectedPayment);
      enroll.set("receipt", parseFile);
      enroll.set("status", "pending"); // Default status

      await enroll.save();
      alert("·Äû·ÄÑ·Ä∫·Äê·Äî·Ä∫·Ä∏·Ä°·Äï·Ä∫·Äî·Äæ·Ä∂·Äô·Äæ·ÄØ ·Ä°·Ä±·Ä¨·ÄÑ·Ä∫·Äô·Äº·ÄÑ·Ä∫·Äï·Ä´·Äû·Ää·Ä∫·Åã ·ÅÅ·ÅÖ ·Äô·Ä≠·Äî·ÄÖ·Ä∫·ÄÅ·Äî·Ä∑·Ä∫ ·ÄÖ·Ä±·Ä¨·ÄÑ·Ä∑·Ä∫·ÄÜ·Ä≠·ÄØ·ÄÑ·Ä∫·Ä∏·Äï·Ä±·Ä∏·Äï·Ä´·ÄÅ·ÄÑ·Ä∫·Äó·Äª·Ä¨·Åã üöÄ");
      setShowEnrollForm(false); setSelectedCourse(null);
    } catch (error) {
      alert("Error: " + error.message);
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div style={styles.pageWrapper}>
      {/* NAVBAR */}
      <nav style={styles.nav}>
        <h2 style={styles.logo}>2 CYBER_SHIELD</h2>
      </nav>

      {/* MISSIONS GRID */}
      <div style={styles.introContainer}>
        <h2 style={styles.sectionTitle}>[ SELECT YOUR TRAINING ]</h2>
        <div style={styles.missionGrid}>
          {courses.map((course) => (
            <div key={course.id} style={styles.missionShapeCard}>
              <div style={{...styles.imgWrap, backgroundImage: `url(${course.img})`}}></div>
              <div style={styles.missionText}>
                <h3 style={{ color: '#00ff41' }}>{course.title}</h3>
                <div style={{color: '#00ff41', marginBottom: '15px'}}>{course.price}</div>
                <button onClick={() => { setSelectedCourse(course); setShowEnrollForm(true); }} style={styles.shapeBtn}>ENROLL NOW</button>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* REGISTRATION FORM MODAL */}
      {showEnrollForm && (
        <div style={styles.modalOverlay} onClick={() => setShowEnrollForm(false)}>
          <div style={styles.modalContent} onClick={e => e.stopPropagation()}>
            <div style={styles.modalMain}>
              <h3 style={{ color: '#00ff41', textAlign: 'center' }}>REGISTRATION FORM</h3>
              <input style={styles.input} placeholder="NAME (·Ä°·Äô·Ää·Ä∫)" onChange={e => setStudentName(e.target.value)} />
              <input style={styles.input} placeholder="PHONE (·Äñ·ÄØ·Äî·Ä∫·Ä∏·Äî·Ä∂·Äï·Ä´·Äê·Ä∫)" onChange={e => setPhoneNumber(e.target.value)} />

              <div style={styles.paymentFlex}>
                {Object.keys(payments).map(key => (
                  <div key={key} onClick={() => setSelectedPayment(key)} 
                       style={{...styles.payIconBox, borderColor: selectedPayment === key ? '#00ff41' : '#233554'}}>
                    <img src={payments[key].logo} style={styles.payLogoImg} alt={key} />
                  </div>
                ))}
              </div>

              <div style={styles.accDisplay}>
                <p style={{margin: 0, fontSize: '11px', color: '#8892b0'}}>{payments[selectedPayment].name}</p>
                <h4 style={{margin: '5px 0', color: '#00ff41'}}>{payments[selectedPayment].acc}</h4>
              </div>

              <label style={styles.uploadArea}>
                <input type="file" hidden onChange={handleFileChange} accept="image/*" />
                {!receiptPreview ? (
                  <div style={{color: '#00ff41', fontSize: '12px'}}>üì∏ ·ÄÑ·ÄΩ·Ä±·Äú·ÄΩ·Ä≤·Äï·Äº·Ä±·ÄÖ·Ä¨ ·Äê·ÄÑ·Ä∫·Äõ·Äî·Ä∫</div>
                ) : (
                  <img src={receiptPreview} style={{height: '80px', borderRadius: '4px'}} alt="Preview" />
                )}
              </label>

              <button style={styles.enrollBtn} onClick={handleSubmitMission} disabled={isSubmitting}>
                {isSubmitting ? "SENDING..." : "CONFIRM ENROLL"}
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};
